Опис:
Здам в оренду квартиру за адресою м. Львів, вул. Манастирського, 2. Новобудова «Інтергалбуд». 3-ій поверх дев ’ ятиповерхового будинку. Центральне опалення. Загальна площа – 78 кв.м. Три кімнати, дві з яких ізольовані. Два великі балкони. Сучасний ремонт. Гардероб. Роздільні санвузли. Квартира не експлуатувалась, повністю умебльована, повний комплект побутової техніки, нова сантехніка. Сигналізація ДСО. Інтернет ( Wi - Fi ) , кабельне телебачення, домофон. Чистий під ’ їзд, кодовий замок.Відеонагляд в під ’ їзді. В будинку є підземний паркінг. Квартира повністю готова до заселення (посуд, постільна білизна . . .). Хороша інфраструктура району: 
- зупинки громадського транспорту; 
- спортивний клуб « Sport Life »; 
- центр водного відпочинку «Дельфін»; 
- ринок «Шувар»; 
- супермаркет «Таврія»; 
- супермаркет «Рукавичка»; 
- супермаркет «Арсен»; 
- супермаркет «Сільпо».
